let radius = IN[0];
let PI = IN[1];
let sq3 = IN[2];
let points = [];

let i = 0;
while i < 6 {
    let angle = i * PI / 3.0; // 60度刻み
    let x = radius * cos(angle);
    let y = radius * sin(angle);
    points.push([x, y, 0.0]);
    i += 1;
}

